import React from 'react';
import './css/VisionBoard.css';

const VisionBoard = () => {
  // Sample images - you can replace these with your actual image URLs
  const images = [
    { id: 1, src: 'https://picsum.photos/300/400?random=1', alt: 'Vision 1' },
    { id: 2, src: 'https://picsum.photos/300/500?random=2', alt: 'Vision 2' },
    { id: 3, src: 'https://picsum.photos/300/350?random=3', alt: 'Vision 3' },
    { id: 4, src: 'https://picsum.photos/300/450?random=4', alt: 'Vision 4' },
    { id: 5, src: 'https://picsum.photos/300/380?random=5', alt: 'Vision 5' },
    { id: 6, src: 'https://picsum.photos/300/520?random=6', alt: 'Vision 6' },
    { id: 7, src: 'https://picsum.photos/300/420?random=7', alt: 'Vision 7' },
    { id: 8, src: 'https://picsum.photos/300/360?random=8', alt: 'Vision 8' },
    { id: 9, src: 'https://picsum.photos/300/480?random=9', alt: 'Vision 9' },
    { id: 10, src: 'https://picsum.photos/300/400?random=10', alt: 'Vision 10' },
    { id: 11, src: 'https://picsum.photos/300/440?random=11', alt: 'Vision 11' },
    { id: 12, src: 'https://picsum.photos/300/390?random=12', alt: 'Vision 12' },
    { id: 13, src: 'https://picsum.photos/300/510?random=13', alt: 'Vision 13' },
    { id: 14, src: 'https://picsum.photos/300/370?random=14', alt: 'Vision 14' },
    { id: 15, src: 'https://picsum.photos/300/460?random=15', alt: 'Vision 15' },
    { id: 16, src: 'https://picsum.photos/300/330?random=16', alt: 'Vision 16' },
    { id: 17, src: 'https://picsum.photos/300/490?random=17', alt: 'Vision 17' },
    { id: 18, src: 'https://picsum.photos/300/410?random=18', alt: 'Vision 18' },
    { id: 19, src: 'https://picsum.photos/300/350?random=19', alt: 'Vision 19' },
    { id: 20, src: 'https://picsum.photos/300/470?random=20', alt: 'Vision 20' },
    { id: 21, src: 'https://picsum.photos/300/390?random=21', alt: 'Vision 21' },
    { id: 22, src: 'https://picsum.photos/300/430?random=22', alt: 'Vision 22' },
    { id: 23, src: 'https://picsum.photos/300/380?random=23', alt: 'Vision 23' },
    { id: 24, src: 'https://picsum.photos/300/500?random=24', alt: 'Vision 24' },
    { id: 25, src: 'https://picsum.photos/300/360?random=25', alt: 'Vision 25' },
    { id: 26, src: 'https://picsum.photos/300/440?random=26', alt: 'Vision 26' },
    { id: 27, src: 'https://picsum.photos/300/420?random=27', alt: 'Vision 27' },
  ];

  return (
    <div className="vision-board">
      <div className="vision-board-header">
        <h1>Vision Board</h1>
        <p>A collection of inspirational images and goals</p>
      </div>

      <div className="masonry-grid">
        {images.map((image) => (
          <div key={image.id} className="masonry-item">
            <img 
              src={image.src} 
              alt={image.alt}
              loading="lazy"
              onError={(e) => {
                e.target.src = 'https://via.placeholder.com/300x400/ff69b4/ffffff?text=Vision+' + image.id;
              }}
            />
            <div className="masonry-overlay">
              <span>{image.alt}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default VisionBoard;
